<html>
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, user-scalable=no">
    <meta name="mobile-web-app-capable" content="yes">

    <meta property="og:title" content="Bhagad House Booking Private App" />
    <meta property="og:description" content="Bhagad House Booking is a private app and it's code open sourced." />
    <meta property="og:image" content="/images/thumbnail.png" />
    <meta property="og:image:type" content="image/png" />
    <meta property="og:image:width" content="400" />
    <meta property="og:image:height" content="600" />


    <link rel="icon" type="image/x-icon" href="/favicon.ico">
    <title>Bhagad House Booking</title>
    <script src="/wasm.js"></script>
    <style>
        html, body, pre {
            margin: 0;
            padding: 0;
        }

        html, body {
            display: block;
            height: 100%;
            width: 100%;
        }

        #app-loader {
            display: flex;
            height: 100%;
            width: 100%;
            flex-direction: column;
            justify-content: space-evenly;
            align-items: center;
        }

        #app-loader-content {
            font-size: 30px;
            text-align: center;
        }

        #app-loader-content:after {
            overflow: hidden;
            display: inline-block;
            vertical-align: bottom;
            -webkit-animation: ellipsis steps(4, end) 900ms infinite;
            animation: ellipsis steps(4, end) 900ms infinite;
            content: "\2026"; /* ascii code for the ellipsis character */
            width: 0px;
        }

        @keyframes ellipsis {
            to {
                width: 1.25em;
            }
        }

        @-webkit-keyframes ellipsis {
            to {
                width: 1.25em;
            }
        }
    </style>
    <style>
        .bhagad_house_image_container {
            display: flex;
            align-items: center;
            justify-content: center;
            width: 100%;
            animation: bounce 0.5s;
            animation-direction: alternate;
            animation-timing-function: cubic-bezier(.5, 0.05, 1, .5);
            animation-iteration-count: infinite;
        }

        @keyframes bounce {
            from {
                transform: translate3d(0, 0, 0);
            }
            to {
                transform: translate3d(0, 100px, 0);
            }
        }
        /* Prefix Support */

        .bhagad_house_image_container {
            -webkit-animation-name: bounce;
            -webkit-animation-duration: 0.5s;
            -webkit-animation-direction: alternate;
            -webkit-animation-timing-function: cubic-bezier(
                    .5, 0.05, 1, .5);
            -webkit-animation-iteration-count: infinite;
        }
        .bhagad_house_image {
            height: 200px;
            width: 200px;
        }

        @-webkit-keyframes bounce {
            from {
                -webkit-transform: translate3d(0, 0, 0);
                transform: translate3d(0, 0, 0);
            }
            to {
                -webkit-transform: translate3d(0, 200px, 0);
                transform: translate3d(0, 200px, 0);
            }
        }
    </style>
</head>
